var tipuesearch = {"pages": [{'title': 'About', 'text': 'This is  https://github.com/mdecourse/cmstemplate \n 目前的 cmsimde 在編輯器下方新增一個 csave 按鈕, 意即 collabrative save, 當動態網際管理系統在多人同時維護登入維護網頁內容時, 編輯各頁面時段, 該頁面可能已經改版, 因此使用 csave 按鈕存檔時, 會導入當下最新的該頁面內容, 並試圖與編輯中的頁面內容進行合併. \n 使用 csave 按鈕存檔無法刪除頁面資料. \n 使用 Edit All 模式, 無法使用 csave 按鈕（尚未測試). \n', 'tags': '', 'url': 'About.html'}, {'title': '上課內容', 'text': '', 'tags': '', 'url': '上課內容.html'}, {'title': 'w1', 'text': '還未選課沒上到課 \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2', 'text': '更改標題 \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '改版 \n 我上課時要改成最新版結果失敗了，詢問老師後，好像是我有弄壞一部份的靜態，需要從遠端重新抓新的下來，下課後抽時間重新抓了一次，然後又把up_dir資料夾更新，這次沒有跑一大堆錯誤出來，但我看資料夾並沒有上課所說的五個檔案，需要星期四上課再去詢問老師。 \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w4', 'text': '成功的把上禮拜失敗的改版完成了，原因是，git pull指令無法被接受，需要指定哪個檔案(遠端的分支)。 \n 課表原始碼介紹利用和開啟各個課表的方法(更改那些變數，和必要的變數),回去用ssh跟github連線 \n 回家後測試使用SSH，結果失敗了，尋找錯誤的方法中。....... \n', 'tags': '', 'url': 'w4.html'}, {'title': 'w5', 'text': '今天老師上課教我們如何設定SSH，也讓我知道握哪裡設定錯誤，島是之前的錯誤，教學完後還有太多人不懂所以我就去幫同學解決他們發生錯誤的地方 \n', 'tags': '', 'url': 'w5.html'}, {'title': 'SSH', 'text': '1.首先我們需要登入github在自己的帳號中開啟設定，在設定中尋找SSH and GPG keys ，然後先按New SSHkey做準備。 \n 2.在 start_ipv6.bat 加入 \xa0 set GIT_SSH=%Disk%:\\putty\\plink.exe。 \n 3.開啟 Putty 目錄中的 puttygen.exe,(沒有putty從a.kmol.info:88下載)，點擊Generate下載新Key，上面出現的亂碼為新鑰匙，全選後丟進剛剛在github預備的New SSHkey，記得用SciTE 編輯儲存鑰匙(id_rsa 檔)，然後用Save private key再存一次(.ppk檔) \n 4.開啟 putty.exe建立一個 session用於以 ssh 協定連線到 github.com,名稱可任意但Proxy須設定學校的(筆電不用Proxy可以選None)，Autu記得選之前處存.ppk的檔案 \n 5.最後則是要修改.git裡面config的urrl(之淺的可在前面加#即可)，url改成git@( session的名子) :(帳號)/(倉儲名子).git \n', 'tags': '', 'url': 'SSH.html'}]};